class Solution:
    # @param A : list of integers
    # @param B : integer
    # @return a list of integers
    def solve(self, A, B):
        if len(A) == 0:
            return -1

        # approach 1
        i, j = 0, 0
        current_sum = 0
        while i < len(A) and j < len(A):

            current_sum += A[j]
            while current_sum > B:
                current_sum -= A[i]
                i += 1

            if current_sum == B:
                if i == j:
                    return A[i]
                else:
                    return A[i:j+1]

            j += 1

        return -1

